import React, { useState } from "react";
import cancel from '../components/images/cancel.jpg';
import black_x from "../components/images/black_x.jpg";
import axios from 'axios';
import { useNavigate } from 'react-router-dom'; // Import useNavigate from React Router

const CreateUser = () => {

  const navigate = useNavigate(); // Initialize navigate
  const [formData, setFormData] = useState({
    username: '',
    email: '',
    password: ''
  });

  const [user, setUser] = useState({
    username: "",
    password: "",
    month: "",
    date: "",
    year: ""
  });

  const currentYear = new Date().getFullYear();

  const handleChange = event => {
    setFormData({
      ...formData,
      [event.target.name]: event.target.value
    });
  };

  const handleUserChange = (e) => {
    const { name, value } = e.target;
    setUser((prev) => ({
      ...prev,
      [name]: value
    }));
  };

  const handleSubmit = async event => {
    event.preventDefault();
    try {
      const response = await axios.post('http://127.0.0.1:8000/users/', formData);
      console.log(response.data);
      // Optionally, handle the response
      navigate('/signin'); // Redirect to /signin

    } catch (error) {
      console.error('Error creating user:', error);
    }
  };

  return (
    <div className="logo-box">
      <div className="cross">
        <a href="/public">
          <img height="10px" width="10px" src={cancel} alt="cancel" />
        </a>
      </div>
      <img src={black_x} alt="black" className="logo" />
      <h2>Create your account</h2>
      <form onSubmit={handleSubmit} className="forms_fields">
        <input
          className="box_1"
          type="text"
          name="username"
          value={formData.username}
          onChange={handleChange}
          placeholder="Name"
          maxLength="50"
        />
        <input
          className="box_1"
          type="text"
          name="email"
          value={formData.email}
          onChange={handleChange}
          placeholder="Email"
        />
        <input
          className="box_1"
          type="password"
          name="password"
          value={formData.password}
          onChange={handleChange}
          placeholder="Password"
          maxLength="20"
        />
        <div className="line">
          <div>Use Email Instead</div>
        </div>
        <div className="dob">Date of Birth</div>
        <div>This will not be shown publicly. Confirm your own age, even if this account is for a business, a pet, or something else.</div>
        <div className="all_boxes">
          <div className="box_A month"></div>
          <div className="box_A date">
            <label>Date</label>
            <select value={user.date} onChange={handleUserChange} name="date" className="select">
              {/* Generate options for dates from 01 to 30 */}
              {Array.from({ length: 30 }, (_, index) => {
                const day = index + 1;
                const formattedDay = day < 10 ? `0${day}` : `${day}`; // Add leading zero if day is less than 10
                return (
                  <option key={formattedDay} value={formattedDay}>{formattedDay}</option>
                );
              })}
            </select>
          </div>
          <div className="box_A year">
            <label>Year</label>
            <select name="year" value={user.year} onChange={handleUserChange} className="select">
              {/* Generate options for years from 1980 to current year */}
              {Array.from({ length: currentYear - 1980 + 1 }, (_, index) => {
                const year = 1980 + index;
                return (
                  <option key={year} value={year}>{year}</option>
                );
              })}
            </select>
          </div>
        </div>
        <button className="Nex" type="submit">Next</button>
      </form>
    </div>
  );
}

export default CreateUser;
